import React, {Component} from 'react';
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import {Home} from './Home';
import {Projects} from './Projects';
import {Contact} from './Contact';
import {NoMatch} from './NoMatch';
import { Layout } from './components/Layout';
import { NavigationBar} from './components/NavigationBar';
import { Jumbotron } from './components/Jumbotron';
import { HashLink as Link } from 'react-router-hash-link';
import { ResumePDF } from './components/Resume';
import styled from 'styled-components';
import { Separator } from './components/SeparatorComponent';
import AlkesSemiBd from './fonts/AlkesSemiBd.woff';


const Styles = styled.div`

  @font-face {
  font-family: 'Alkes Semibold';
  font-style: normal;
  font-weight: normal;
  src: local('Alkes Semibold'), url(${AlkesSemiBd}) format('woff');
  }

  #contact, #about, #resume {
    height : 100px;
  }

  #resumeContent {
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: center;
  }


  #navBar {
    height: 60px;
    width: 100%;
  }

  #projects {
    padding: 0 10vh 10vh 10vh;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    background-color: #343A40;
  }

  #title {
    color: #F28D8D;
    text-align: center;
    padding: 3vh;
    font-family: 'Alkes Semibold';
    font-size: 5vh;
    background-color: white;
    margin-top: 2vh;
  }

  .videoContainer {
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    height: 90vh;
    width: 100vw;
  }
`;

class App extends Component {
  render() {
    return (
      // creates a wrapper
      <React.Fragment> 
        <Router>
            <div id="navBar">
              <NavigationBar />
            </div>
            <Switch>
              <Link to="/#home"/>
              <Link to="/#contact"/>
              <Link to="/#resume"/>
              <Link to="/#projects"/>
              <Route component={NoMatch} />
              <Link to="/#anchor"></Link>
            </Switch>
          </Router>
        <Styles>
          <div id = "container">
          <div id = "home"/>
          <div >
            <Home />
          </div>
          <div id="projects">
            <div id="title">Projects</div>
            <Projects />
          </div>

          <div id="resume"/>
          <div id="resumeContent">

          <embed src={require('./assets/Resume.pdf')} width="50%" height="1000px"></embed>

          </div>

          <div id="contact"/>
          <div >
            <Contact />
          </div>
          </div>
        </Styles>
      </React.Fragment>
    );
  }

}

export default App;
